def orderSwap(littleOrder):
    output = ""
    for x in range(len(littleOrder),0,-2):
        output += littleOrder[x-2:x]
    return output


ediVal = "2F72D1BB"
ediMul = "7A835F5F"
ediAdd = "2F72D1BB"
fullVal = ""
final = ""
for x in range(0,len(fullVal),8):
    encValue = orderSwap(fullVal[x:x+8])

    bytesEnc = bytes.fromhex(encValue)

    bytesEdi = bytes.fromhex(ediVal)

    output = bytes(a ^ b for a, b in zip(bytesEnc, bytesEdi))
    output = orderSwap(output.hex())
    
    final += output

    ediVal = hex((int(ediVal,16) * int(ediMul,16))+int(ediAdd,16))
    ediVal = ediVal[-8:]

print(final)
